              <th>Typecode</th>
              <th>SerialNumber</th>
              <th>Registered</th>
              <th>Category Description</th>
              <th>Status</th>
              <th>Registration</th>
              <th>Icao</th>
              <th>Name</th>
              <th>Linenumber</th>
              <th>Type</th>
              <th>Operator</th>
              <th>Callsign</th>
              <th>OperatorIcao</th>
              <th>OperatorIata</th>
              <th>Owner</th>
