                  <td>{post.reguntil}</td>
                  <td>{post.built}</td>
                  <td>{post.firstflightdate}</td>
                  <td>{post.seatconfiguration}</td>
                  <td>{post.engines}</td>
                  <td>{post.modes}</td>
                  <td>{post.adsb}</td>
                  <td>{post.acars}</td>
                  <td>{post.notes}</td>
                  <td>{post.categorydescription}</td>
                  <td>{post.status}</td>
                </tr>
              ))}
            </tbody>
          </table>
       </div>
       {/* <nav className="d-flex">
